import React from 'react'

const Navbar = () => {
  return (
    <div>
        <span>Redux Store</span>
        <div>
            <Link to='/'>Home</Link>
            <Link to='/cart'>Cart</Link>
        </div>
    </div>
  )
}

export default Navbar
